import React from 'react';
import { Grid, Header, Image } from 'semantic-ui-react';
import RoverDataLogo from '../rover-data.png';
import AutoNavLogo from '../autonav.png';
import RoseLogo from '../rose-logo.png';

class RoverData extends React.Component {
  render() {
          return (

      <Grid Container centered id="rover-data-page" columns={2}>
        <Grid.Row>
          <Header as="h1" textAlign="center">ARM</Header>
        </Grid.Row>
        <Grid.Row>
          <Grid.Column>
	    <Grid.Row>
	      <Image src={RoverDataLogo} size="large" centered/>
	    </Grid.Row>
            <Grid.Row>
	      <Header as="h2" textAlign="center">Rover Specifications</Header>
	    </Grid.Row>
          </Grid.Column>
	  <Grid.Column>
	    <Image fluid label={{as: 'a', corner: 'left', image: `${RoseLogo}`}} src={RoseLogo} centered/>
	  </Grid.Column>
	</Grid.Row>
      </Grid>
        );
  };
}

export default RoverData;
